function Button({ ...props }) {
	const Button = styled.button`
		padding: 0.5rem;
	`;

	Button.defaultProps = {
		theme: {
			main: 'transparent',

			//#6bbcff;
		},
	};

	const theme = {
		main: '6bbcff',
		hover: '#5e90e6',
	};

	return <Button>{props.children}</Button>;
}

export default Button;
